import React, { Component } from 'react'

export default class Conditional extends Component {
     constructor(props){
        super(props)
        this.state = {
            changeValue:''
        }
     }
    onChangeHandler = (e) =>{
       this.setState({
        changeValue: e.target.value
       })
    }
  render() {
    return (
      <div>
          
          <input onChange={this.onChangeHandler} type="text"  />

      </div>
    )
  }
}
